import React, {Fragment} from 'react'
import defaultSlide from '../../assets/default-slide.jpg'

import {
    HorizontalLine
} from './styled'

const BackgroundLinesComponent = () => {   

    const renderHorizontalLines = () => {
        let item = [];
        for (let i = 0; i < 8; i++) {
          item.push(
            <HorizontalLine 
              key={ i }
            />
          );
        }
        return item;
    };

    const renderVerticalLines = () => {
        let item = [];
        for (let i = 0; i < 8; i++) {
          item.push(
            <HorizontalLine 
              key={ i }
            />
          );
        }
        return item;
    };

    return (
        <Container>
            {renderHorizontalLines}
            {renderVerticalLines}

        </Container>
    )
}


export default BackgroundLinesComponent;
